USE Breakaway

CREATE TABLE Departments
(
	ID INT IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Name NVARCHAR(256) NOT NULL
);

CREATE TABLE EmployeeTypes
(
	ID INT IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Name NVARCHAR(256) NOT NULL
);
CREATE TABLE Employees
(
	ID INT IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Name NVARCHAR(256) NOT NULL,
	FKDepartmentID INT NOT NULL FOREIGN KEY REFERENCES Departments(ID),
	EmploymentStartDate DATE NOT NULL,
	IsActive BIT NOT NULL,
	FKTypeID INT NOT NULL FOREIGN KEY REFERENCES EmployeeTypes(ID),
	ManagerMonthlySalary MONEY NULL,
	StandardMonthlySalary MONEY NULL,
	SalesBaseSalary MONEY NULL,
	SalesProvision MONEY NULL,
	HourlySalary MONEY NULL
);

CREATE TABLE TimeReportTypes
(
	ID INT IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Name NVARCHAR(256) NOT NULL
);
CREATE TABLE TimeReports
(
	ID INT IDENTITY(1,1) NOT NULL PRIMARY KEY,
	FKEmployeeID INT NOT NULL FOREIGN KEY REFERENCES Employees(ID),
	[Date] DATE NOT NULL,
	FKTypeID INT NOT NULL FOREIGN KEY REFERENCES TimeReportTypes(ID),
	HoursWorked INT NULL
);

CREATE TABLE Deals
(
	ID INT IDENTITY(1,1) NOT NULL PRIMARY KEY,
	FKSalesEmployeeID INT NOT NULL FOREIGN KEY REFERENCES Employees(ID),
	CustomerName NVARCHAR(256) NOT NULL,
	AgreementDate DATE NOT NULL,
	Price MONEY NOT NULL
);

SET IDENTITY_INSERT Departments ON;
SET IDENTITY_INSERT Departments OFF;
	
SET IDENTITY_INSERT EmployeeTypes ON;
SET IDENTITY_INSERT EmployeeTypes OFF;
	
SET IDENTITY_INSERT Employees ON;
SET IDENTITY_INSERT Employees OFF;
	
SET IDENTITY_INSERT TimeReportTypes ON;
SET IDENTITY_INSERT TimeReportTypes OFF;
	
SET IDENTITY_INSERT TimeReports ON;
SET IDENTITY_INSERT TimeReports OFF;
	
SET IDENTITY_INSERT Deals ON;
SET IDENTITY_INSERT Deals OFF;


